It’s the table that holds the UI definitions for the game. An UI definition is a function that returns a table that has a very strict structure: G.UIDEF.my_ui_definition = function(element) return { n = G.UIT.ROOT, config = {}, nodes = {} }
end Let’s break this down: n = G.UIT.ROOT: n here represents the node “type”. There are several node types available in Balatro T, which is for text nodes B, for boxes (which can be rounded) C, for column layouts R, for row layouts O, for objects (such as cards and such) ROOT, for the root node of an UI definition config: configuration for the node, holds several attributes, each for configuring alignments, or button behavior for instance nodes: is an array of child nodes Think of the Balatro UI definition like you would an HTML document. In HTML, you’d write something like this HTML example <div> <input type="text"></input> <div> <span><p>Some Text</p></span> <span><p>Other Text</p></span> </div>
</div> Which would roughly be equivalent to Example HTML equivalent for Balatro UI { n = G.UIT.ROOT, config = {}, nodes = { { n = G.UIT.I, config = {}, }, { n = G.UIT.C, config = {}, nodes = { { n = G.UIT.R, config = {}, nodes = { { n = G.UIT.T, config = { text = "Some Text" } }, }, }, { n = G.UIT.R, config = {}, nodes = { { n = G.UIT.T, config = { text = "Other Text" } }, }, }, }, }, },
}
